import {Routes} from 'react-router-dom';

export default function BookRoutes(){
  return (
    <Routes>
      <Route index element={<BookList />} />
      <Route path=":id" element={<Book />} />
      <Route path="newbook" element={<NewBook />} />
    </Routes>
  )
}
